import "core-js/modules/es.regexp.flags.js";
import CardCountries from "./CardCountries.vue";
export default {
  created() {
    fetch("https://restcountries.com/v3.1/all").then(el => el.json()).then(json => this.informacion = json.map(el => {
      return {
        nombreO: el.name.official,
        nombreC: el.name.common,
        bandera: el.flags.png,
        poblacion: el.population,
        capital: el.capital
      };
    }));
  },

  name: "ApiCountries",

  data() {
    return {
      informacion: []
    };
  },

  components: {
    CardCountries
  }
};
